// src/App.js
import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';

import Page1 from './components/Page1';
import Page2 from './components/Page2';
import Page3 from './components/Page3';
import Page4 from './components/Page4';
import Page5 from './components/Page5';

function App() {
  return (
    <Router>
      <div style={{ textAlign: 'center' }}>
        <nav style={{ display: 'flex', justifyContent: 'center', marginTop: '20px' }}>
          <Link to="/page1">
            <button style={buttonStyle}>1</button>
          </Link>
          <Link to="/page2">
            <button style={buttonStyle}>2</button>
          </Link>
          <Link to="/page3">
            <button style={buttonStyle}>3</button>
          </Link>
          <Link to="/page4">
            <button style={buttonStyle}>4</button>
          </Link>
          <Link to="/page5">
            <button style={buttonStyle}>5</button>
          </Link>
        </nav>

        <Routes>
          <Route path="/page1" element={<Page1 />} />
          <Route path="/page2" element={<Page2 />} />
          <Route path="/page3" element={<Page3 />} />
          <Route path="/page4" element={<Page4 />} />
          <Route path="/page5" element={<Page5 />} />
        </Routes>
      </div>
    </Router>
  );
}

const buttonStyle = {
  margin: '0 10px', // 버튼 간격
  padding: '10px 20px', // 버튼 크기
  fontSize: '16px', // 글자 크기
  borderRadius: '5px', // 둥근 모서리
  backgroundColor: '#4CAF50', // 버튼 배경색
  color: 'white', // 글자 색
  border: 'none', // 테두리 없애기
  cursor: 'pointer', // 마우스 커서 스타일
};

export default App;
